import PagSegona from '../components/PagSegona/PagSegona';

const PagPrimera = () =>     <>

      <PagSegona onChangeHandler={handleChange} 
        webPageCheck={servicesSelected[0].webPage} seoConsultingCheck = {servicesSelected[1].seoConsulting} googleAdsCampaignCheck = {servicesSelected[2].googleAdsCampaign} totalPrice = {totalPrice} />
     
      <Panell handle={handleChangeNumbers}  
          numPagesValue={webPageNumbers.numPages} numLangsValue={webPageLangs.numLangs} 
          changeNumberDown={decreaseNumber} changeNumberUp={increaseNumber}  />
   </>
export default PagPrimera;
